import Vue from 'vue';
import Router from 'vue-router';
import HomePage from '../views/HomePage.vue';
import SearchPlayerPage from '../views/SearchPlayerPage.vue';
import TeamsPage from '../views/TeamsPage.vue';
import AboutPage from '../views/AboutPage.vue';

Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/',
      name: 'home',
      component: HomePage,
    },
    {
      path: '/search',
      name: 'search',
      component: SearchPlayerPage,
    },
    {
      path: '/teams',
      name: 'teams',
      component: TeamsPage,
    },
    {
      path: '/about',
      name: 'about',
      component: AboutPage,
    },
  ],
});
